// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EVoting {
    address public electoralAuthority;
    uint public electionCount;

    mapping(uint => address) public elections;
    event ElectionCreated(uint electionId, string name, bool isPrivate);

    constructor() {
        electoralAuthority = msg.sender;
    }

    modifier onlyElectoralAuthority() {
        require(msg.sender == electoralAuthority, "Seules les autorites electorales peuvent effectuer cette action.");
        _;
    }

    struct Voter {
        uint id;
        string name;
        string surname;
        string email;
    }

    function createElection(
        string memory _name,
        string memory _description,
        uint _startDate,
        uint _endDate,
        bool _isPrivate,
        address[] memory _authorizedVoters // Utiliser des adresses ici
    ) public onlyElectoralAuthority returns (uint) {
        require(_endDate > _startDate, "La date de fin doit etre superieure a la date de debut.");
        require(_startDate >= block.timestamp, "La date de debut doit etre dans le futur.");

        electionCount++;

        // Déployer un nouveau contrat Election
        Election newElection = new Election(
            electionCount,
            _name,
            _description,
            _startDate,
            _endDate,
            msg.sender,
            _isPrivate,
            _authorizedVoters // Passer les adresses des votants autorisés
        );

        // Vérifier que l'adresse du contrat Election est correcte
        require(address(newElection) != address(0), "Erreur lors de la creation de l'election.");

        elections[electionCount] = address(newElection);

        emit ElectionCreated(electionCount, _name, _isPrivate);
        return electionCount;
    }

    function addCandidate(uint _electionId, string memory _name, string memory _program) public onlyElectoralAuthority {
        require(elections[_electionId] != address(0), "L'election specifiee n'existe pas.");

        Election election = Election(elections[_electionId]);
        election.addCandidate(_name, _program);
    }

    function vote(
        uint _electionId,
        uint _candidateId,
        address voterAddress,
        string memory _name,
        string memory _surname,
        string memory _email
    ) public {
        require(elections[_electionId] != address(0), "L'election specifiee n'existe pas.");

        Election election = Election(elections[_electionId]);
        election.vote(voterAddress, _candidateId, _name, _surname, _email);
    }

    function getElections() public view returns (
        uint[] memory, string[] memory, string[] memory, bool[] memory, uint[] memory, uint[] memory, bool[] memory
    ) {
        uint[] memory ids = new uint[](electionCount);
        string[] memory names = new string[](electionCount);
        string[] memory descriptions = new string[](electionCount);
        bool[] memory isPrivateElection = new bool[](electionCount);
        uint[] memory startDates = new uint[](electionCount);
        uint[] memory endDates = new uint[](electionCount);
        bool[] memory isOpen = new bool[](electionCount);

        for (uint i = 1; i <= electionCount; i++) {
            require(elections[i] != address(0), "L'election n'existe pas.");

            Election election = Election(elections[i]);
            (
                string memory name,
                string memory description,
                bool isPrivate_,
                bool open,
                uint startDate,
                uint endDate
            ) = election.getElectionDetails();

            ids[i-1] = i;
            names[i-1] = name;
            descriptions[i-1] = description;
            isPrivateElection[i-1] = isPrivate_;
            startDates[i-1] = startDate;
            endDates[i-1] = endDate;
            isOpen[i-1] = open;
        }

        return (ids, names, descriptions, isPrivateElection, startDates, endDates, isOpen);
    }

    function getOnGoingElections() public view returns (uint[] memory) {
        uint count = 0;
        uint[] memory ongoingElections = new uint[](electionCount);

        for (uint i = 1; i <= electionCount; i++) {
            if (elections[i] == address(0)) continue;

            Election election = Election(elections[i]);
            (,,, bool open, uint startDate, uint endDate) = election.getElectionDetails();

            if (open && block.timestamp >= startDate && block.timestamp <= endDate) {
                ongoingElections[count] = i;
                count++;
            }
        }

        uint[] memory result = new uint[](count);
        for (uint i = 0; i < count; i++) {
            result[i] = ongoingElections[i];
        }

        return result;
    }
}

contract Election {
    struct Candidate {
        uint id;
        string name;
        string program;
        uint voteCount;
    }

    struct Voter {
        uint id;
        string name;
        string surname;
        string email;
        bool hasVoted;
    }

    uint public id;
    string public name;
    string public description;
    uint public candidatesCount;
    uint public startDate;
    uint public endDate;
    bool public votingSessionOpen;
    address public electoralAuthority;
    bool public isPrivate;

    mapping(uint => Candidate) public candidates;
    mapping(address => Voter) public voters;
    mapping(address => bool) public authorizedVoters;

    event CandidateAdded(uint candidateId, string name, string program);
    event Voted(uint electionId, address voter, uint candidateId);

    constructor(
        uint _id,
        string memory _name,
        string memory _description,
        uint _startDate,
        uint _endDate,
        address _electoralAuthority,
        bool _isPrivate,
        address[] memory _authorizedVoters
    ) {
        require(_endDate > _startDate, "La date de fin doit etre superieure a la date de debut.");
        id = _id;
        name = _name;
        description = _description;
        startDate = _startDate;
        endDate = _endDate;
        electoralAuthority = _electoralAuthority;
        isPrivate = _isPrivate;

        if (_isPrivate) {
            for (uint i = 0; i < _authorizedVoters.length; i++) {
                authorizedVoters[_authorizedVoters[i]] = true; // Utilisation des adresses
            }
        }
    }

    modifier onlyElectoralAuthority() {
        require(msg.sender == electoralAuthority, "Seules les autorites electorales peuvent effectuer cette action.");
        _;
    }

    modifier electionOpen() {
        require(block.timestamp >= startDate && block.timestamp <= endDate, "Election non ouverte.");
        _;
    }

    function addCandidate(string memory _name, string memory _program) public onlyElectoralAuthority {
        candidatesCount++;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, _program, 0);
        emit CandidateAdded(candidatesCount, _name, _program);
    }

    function vote(
        address _voter,
        uint _candidateId,
        string memory _name,
        string memory _surname,
        string memory _email
    ) public electionOpen {
        require(_candidateId > 0 && _candidateId <= candidatesCount, "Candidat invalide.");
        require(!voters[_voter].hasVoted, "Deja vote.");

        if (isPrivate) {
            require(authorizedVoters[_voter], "Non autorise a voter dans cette election privee.");
        }

        voters[_voter] = Voter(voters[_voter].id, _name, _surname, _email, true);
        candidates[_candidateId].voteCount++;

        emit Voted(id, _voter, _candidateId);
    }

    function getElectionDetails() public view returns (
        string memory electionName,
        string memory electionDescription,
        bool isPrivateElection,
        bool sessionOpenStatus,
        uint startTimestamp,
        uint endTimestamp
    ) {
        return (
            name,
            description,
            isPrivate,
            block.timestamp >= startDate && block.timestamp <= endDate,
            startDate,
            endDate
        );
    }
}
